import React, { useState } from "react";
import axios from "axios";
import './RankForm.css'; 

const indianStates = [
    "Andhra Pradesh", "Arunachal Pradesh", "Assam", "Bihar", "Chhattisgarh",
    "Delhi", "Goa", "Gujarat", "Haryana", "Himachal Pradesh", "Jharkhand",
    "Karnataka", "Kerala", "Madhya Pradesh", "Maharashtra", "Manipur",
    "Meghalaya", "Mizoram", "Nagaland", "Odisha", "Punjab",
    "Rajasthan", "Tamil Nadu", "Telangana", "Tripura",
    "Uttar Pradesh", "Uttarakhand", "West Bengal"
];

const coursesList = [
    "Aerospace Engineering (4 Years, Bachelor of Technology)",
    "Computer Science and Engineering (4 Years, Bachelor of Technology)",
    "Civil Engineering (4 Years, Bachelor of Technology)"
];

const RankForm = () => {
    const [examType, setExamType] = useState("");
    const [state, setState] = useState("");
    const [gender, setGender] = useState("");
    const [category, setCategory] = useState("");
    const [rank, setRank] = useState("");
    const [selectedCourses, setSelectedCourses] = useState([]);
    const [colleges, setColleges] = useState([]);

    const fetchColleges = async (e) => {
        e.preventDefault();

        if (!examType || !state || !gender || !category || !rank || selectedCourses.length === 0) {
            alert("Please select all fields and at least one course.");
            return;
        }

        try {
            const response = await axios.get(
                `http://localhost:5000/api/colleges/search`,
                {
                    params: {
                        examType,
                        state,
                        gender,
                        category,
                        rank: Number(rank),
                        courses: selectedCourses.join(",")
                    }
                }
            );
            setColleges(response.data);
        } catch (error) {
            console.error("Error fetching data:", error);
            alert("Failed to fetch data. Please try again.");
        }
    };

    const handleCourseChange = (e) => {
        const value = e.target.value;
        if (selectedCourses.includes(value)) {
            setSelectedCourses(selectedCourses.filter(course => course !== value));
        } else if (selectedCourses.length < 3) {
            setSelectedCourses([...selectedCourses, value]);
        } else {
            alert("You can select a maximum of 3 courses.");
        }
    };

    return (
        <div>
            <h2>Find Your College</h2>
            <form onSubmit={fetchColleges}>
                <label>Exam Type:</label>
                <select value={examType} onChange={(e) => setExamType(e.target.value)}>
                    <option value="">Select Exam</option>
                    <option value="jeeMains">JEE Mains</option>
                    <option value="jeeAdvanced">JEE Advanced</option>
                </select>

                <label>State:</label>
                <select value={state} onChange={(e) => setState(e.target.value)}>
                    <option value="">Select State</option>
                    {indianStates.map((s) => (
                        <option key={s} value={s}>{s}</option>
                    ))}
                </select>

                <label>Gender:</label>
                <select value={gender} onChange={(e) => setGender(e.target.value)}>
                    <option value="">Select Gender</option>
                    <option value="GENDER_NEUTRAL">Gender-Neutral</option>
                    <option value="FEMALE_ONLY">Female</option>
                </select>

                <label>Category:</label>
                <select value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="">Select Category</option>
                    <option value="OPEN">OPEN</option>
                    <option value="EWS">EWS</option>
                    <option value="OBC-NCL">OBC-NCL</option>
                    <option value="SC">SC</option>
                    <option value="ST">ST</option>
                </select>

                <label>Select Courses (up to 3):</label>
                <div className="course-selection">
                    {coursesList.map((course) => (
                        <div key={course} className={`course-box ${selectedCourses.includes(course) ? 'selected' : ''}`}>
                            <input
                                type="checkbox"
                                value={course}
                                checked={selectedCourses.includes(course)}
                                onChange={handleCourseChange}
                            />
                            {course}
                        </div>
                    ))}
                </div>

                <label>Enter Your Rank:</label>
                <input
                    type="number"
                    value={rank}
                    onChange={(e) => setRank(e.target.value)}
                    placeholder="Enter your rank"
                    required
                />

                <button type="submit">Search Colleges</button>
            </form>

            {colleges.length > 0 && (
                <div>
                    <h3>Available Colleges:</h3>
                    <ul>
                        {colleges.map((college, index) => (
                            <li key={index}>
                                <strong>{college.name}</strong>
                                <ul>
                                    <li>
                                        {college.courseName}: Opening Rank: {college.rankData.openingRank}, Closing Rank: {college.rankData.closingRank}
                                    </li>
                                </ul>
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default RankForm;
